# Message type constants

TYPE_CREATE = "create"
"Object was created."

TYPE_UPDATE = "update"
"Object was updated."

TYPE_DELETE = "delete"
"Object was deleted."

TYPE_REFRESH = "refresh"
"Refresh message (for example nightly full refresh)."

TYPE_ENUMERATE = "enumerate"
"Enumerate actual object IDs."

TYPE_EOS = "eos"
"End of stream message."
